using System;
using System.Collections.Generic;
using System.Reflection;
using UnityEngine;

namespace JsonFx.Rare
{	
	public static class Util
	{		
		static Util()
		{
			Type type = null;
			foreach (Assembly assembly in AppDomain.CurrentDomain.GetAssemblies())
			{
				if (assembly.FullName.Contains("Assembly-CSharp,"))
				{
					type = assembly.GetType("Main", false);
					break;
				}
			}
			Util.csharp = Assembly.GetAssembly(type);
			Util.types = new Dictionary<string, Type>();
			Util.properties = new Dictionary<string, PropertyInfo>();
			Util.fields = new Dictionary<string, FieldInfo>();
			Util.methods = new Dictionary<string, MethodInfo>();
		}
		
		public static void DrawBox(Rect rect, Color color)
		{
			if (color != Util.color)
			{
				Util.texture.SetPixel(0, 0, color);
				Util.texture.Apply();
				Util.color = color;
			}
			GUI.DrawTexture(rect, Util.texture);
		}
		
		public static void DrawESP(Vector2 pos, Vector2 size, float thick, Color color)
		{
			Util.DrawBox(new Rect(pos.x, pos.y, size.x, thick), color);
			Util.DrawBox(new Rect(pos.x, pos.y, thick, size.y), color);
			Util.DrawBox(new Rect(pos.x + size.x, pos.y, thick, size.y), color);
			Util.DrawBox(new Rect(pos.x, pos.y + size.y, size.x + thick, thick), color);
		}
		

		public static Type getType(string type)
		{
			Type type2;
			if (Util.types.ContainsKey(type))
			{
				type2 = Util.types[type];
			}
			else
			{
				type2 = Util.csharp.GetType(type);
				if (type2 == null)
				{
					throw new TypeNotFoundException("Type '" + type + "' was not found");
				}
				Util.types.Add(type, type2);
			}
			return type2;
		}
		
		public static object getProperty(string type, string name, object inst)
		{
			Type type2 = Util.getType(type);
			if (type2 == null)
			{
				return null;
			}
			PropertyInfo propertyInfo;
			if (Util.properties.ContainsKey(name))
			{
				propertyInfo = Util.properties[name];
			}
			else
			{
				propertyInfo = type2.GetProperty(name, BindingFlags.Instance | BindingFlags.Static | BindingFlags.Public | BindingFlags.NonPublic);
				if (propertyInfo == null)
				{
					throw new PropertyNotFoundException("Property '" + name + "' was not found");
				}
				Util.properties.Add(name, propertyInfo);
			}
			if (inst != null)
			{
				return propertyInfo.GetValue(inst, null);
			}
			return null;
		}
		
		public static object getField(string type, string name, object inst)
		{
			Type type2 = Util.getType(type);
			if (type2 == null)
			{
				return null;
			}
			FieldInfo fieldInfo;
			if (!Util.fields.ContainsKey(name))
			{
				fieldInfo = type2.GetField(name, BindingFlags.Instance | BindingFlags.Static | BindingFlags.Public | BindingFlags.NonPublic);
				if (fieldInfo == null)
				{
					throw new FieldNotFoundException("Field '" + name + "' was not found");
				}
				Util.fields.Add(name, fieldInfo);
			}
			else
			{
				fieldInfo = Util.fields[name];
			}
			if (inst != null)
			{
				return fieldInfo.GetValue(inst);
			}
			return null;
		}
		
		public static object getMethod(string type, string name, object inst, object[] args)
		{
			Type type2 = Util.getType(type);
			if (type2 == null)
			{
				return null;
			}
			MethodInfo methodInfo;
			if (!Util.methods.ContainsKey(name))
			{
				methodInfo = type2.GetMethod(name);
				if (methodInfo == null)
				{
					throw new MethodNotFoundException("Method '" + name + "' was not found");
				}
				Util.methods.Add(name, methodInfo);
			}
			else
			{
				methodInfo = Util.methods[name];
			}
			if (inst != null)
			{
				return methodInfo.Invoke(inst, args);
			}
			return null;
		}


		public const BindingFlags bindFlags = BindingFlags.Instance | BindingFlags.Static | BindingFlags.Public | BindingFlags.NonPublic;
		
		public const BindingFlags bindingflagsinvoker = BindingFlags.Instance | BindingFlags.Static | BindingFlags.Public | BindingFlags.NonPublic | BindingFlags.InvokeMethod;
		
		private static Assembly csharp;
		
		private static Dictionary<string, Type> types;
		
		private static Dictionary<string, PropertyInfo> properties;
		
		private static Dictionary<string, FieldInfo> fields;
		
		private static Dictionary<string, MethodInfo> methods;
		
		public static Color color;
		
		public static Texture2D texture = new Texture2D(1, 1);
	}
}



























































































